export enum Trend {
    DECREASING = -1,
    NOCHANGE = 0,
    INCREASING = 1,
}

export const getTrend = (a : number | undefined, b : number | undefined) : Trend =>{


    console.log("TREND", a, b);

    if(a === undefined || b === undefined) return Trend.NOCHANGE;

    return b > a ? Trend.INCREASING
    : b < a ? Trend.DECREASING 
    : Trend.NOCHANGE;

}

